"use es6";

import React from "react";

const HomePage = () => {
  const link1 = `https://sedo.com/us/photos.html`;
  const link2 = `https://www.cnn.com/`;

  const source1 = `${link1.find("img").first().attr("src")}`;
  const source2 = `${link2.find("img").first().attr("src")}`;

  //   document.getElementById("img1").src =
  //     "https://cdn.cnn.com/cnnnext/dam/assets/211216125209-cleveland-browns-raiders-covid-nfl-spt-intl-file-121221-large-tease.jpg";
  //   document.getElementById("img2").src =
  //     "https://static01.nyt.com/images/2021/12/16/science/16virus-omicron1/16virus-omicron1-threeByTwoMediumAt2X.jpg";
  return (
    <>
      <div>
        <h1>HOME</h1>

        <img
          id="img1"
          src="https://media.geeksforgeeks.org/wp-content/uploads/20190506164011/logo3.png"
          alt="img1"
        />
        <img id="img2" src="" alt="img2" />
      </div>
    </>
  );
};

export default HomePage;
